import Navbar from "./Navbar";
import Hero from "Hero";
import Summary from "./Summary";
import Skills from "./Skills";
import Experience from "Experience";
import Projects from "./Projects";
import Education from "./Education";
import Footer from "./Footer";

/*************  ✨ Windsurf Command ⭐  *************/
/**
 * The main App component.
 *
 * This component renders the entire application, including the Navbar,
 * Hero section, Summary section, Skills section, Experience section,
 * Projects section, Education section, and Footer.
 *
 * @returns {JSX.Element} The rendered App component.
 */
/*******  25c25132-18ae-4c4a-84a4-0d0917b039f3  *******/
export default function App() {
  return (
    <div className="text-slate-700">
      <Navbar />
      <main className="max-w-7xl mx-auto py-12 px-4 sm:px-6 lg:px-8">
        <Hero />
        <Summary />
        <Skills />
        <Experience />
        <Projects />
        <Education />
      </main>
      <Footer />
    </div>
  );
}
